export type MonsterProps = {
	name: string;
	stats?: {
		str: number;
		dex: number;
		con: number;
		int: number;
		wis: number;
		cha: number;
	};
	hp: number;
	ac: number;
	speed: number;
};

export const mockMonsters: MonsterProps[] = [
	{
		name: "Orc Sniper",
		hp: 40,
		ac: 14,
		speed: "30ft",
	},
];
